                                <div cla");
                WriteLiteral(@"ss=""tab-pane fade show active"" id=""pills-home"" role=""tabpanel"" aria-labelledby=""pills-home-tab"">
                                    <h3 class=""tab-title"">Ürün Açıklaması</h3>
                                    <p>
                                        Vincent van Gogh'un intihar etmeden önce yaptığı son tablosu. bazı akademisyenler intihar notu olarak bıraktığını da düşünür. çok net bir bilgi olmamakla birlikte, kimilerine göre bu van gogh'un son resmi değildir. bu resimden sonra üç adet tablo daha yaptığı söylenir. art izlenimcilik akımına iyi bir örnektir.
                                    </p>
                                    <p>
                                        Tablo, 1890 yılında tamamlanmış ve yağlı boyayla tuval üzerine yapılmıştır. son eseri olarak benimsendiği için, resmin içerisinde bir çok karanlık ve depresif öğeyi barındırdığı söylenir. buğday tarlası resmin yarısından fazlasını kaplar. buğday başaklarının her yöne farklı dalgalanmaları rüzgarlı bir hava olduğundan kaynaklıd");
                WriteLiteral(@"ır. resimde, toplamda üç farklı patika yol vardır. bu 3 farklı yolunda nereye gittiği ve ne amaca hizmet ettiği belli değildir. bu yüzden karmaşık, kafa karıştırıcı ve depresif bir görüntü ortaya koyar. oldukça canlı renklere sahip buğday başaklarına tezat olarak, siyah ve mavi tonlarının kullanıldığı gökyüzü ise karamsar bir etki yaratır. yaklaşmakta olan bir fırtına habercisi olan gökyüzü ve esen rüzgar, tarlada uçuşan kargalarla ruhsal bir sıkıntıya sebep olur. bu sebeple, yapılan bu tablo, van gogh'un son zamanlardaki ruhsal sıkıntısının açığa çıkması ve intihar notu olarak algılanmasına sebep olmuştur.
                                    </p>
                                    <p>
                                        farklı görüşlerde vardır. geniş ve açık renklerde buğday tarlası, boş patikalar ve uçuşan kargaların; mutlak sessizliği ve huzuru da yansıttığı söylenir. van gogh bu resminde, ölmeden önce huzura olan özlemini vurgulamakta da olabilir. resimde bulunan her öğe, farklı şekillerde yoruml");
                WriteLiteral(@"anabilir. fakat her ne olursa olsun, bu tablo van gogh'un yorulmuşluğunun bir yansımasıdır.
                                    </p>
                                </div>
                                <div class=""tab-pane fade"" id=""pills-profile"" role=""tabpanel"" aria-labelledby=""pills-profile-tab"">
                                    <h3 class=""tab-title"">Sanatçının Hayatı</h3>
                                    <p>
                                        Vincent Willem van Gogh 30 Mart 1853 - 29 Temmuz 1890), Hollandalı ard izlenimci ressam. Batı dünyası sanat tarihinin en tanınmış ve en etkili şahsiyetlerinden biridir. On yıldan biraz fazla bir süre içinde aralarında 860 yağlı boya tablonun da olduğu 2.100 kadar resim ve çizim çalışması üretti ve bunların çoğu yaşamının son iki yılında yapıldı. Bunların arasında manzaralar, natürmortlar, portreler ve otoportreler bulunmaktadır ve modern sanatın temelleri sayılan cür'etkâr renkler ile canlı, fevrî ve ifade dolu fırça darbeleriyle ayırt edilirler. 3");
                WriteLiteral(@"7 yaşında yıllardır süren psikolojik rahatsızlığı ve yoksulluğun ardından trajik bir biçimde kimilerine göre intihar, kimilerine göre bir cinayet sebebiyle silahla yaralandıktan birkaç gün sonra hayata veda etti.
                                    </p>
                                    <p>
                                        Üst orta sınıf bir aileye doğan van Gogh çocukken ciddi, sessiz ve saygılıydı ayrıca resim de yapmaktaydı. Gençliğinde sanat simsarı olarak çalıştı ancak Londra'ya gönderildikten sonra bunalıma girdi. Döndükten sonra Belçika'nın güneyinde Protestant misyoner olarak çalıştı. Sağlığı bozulup yalnızlık içinde yaşadıktan sonra ebeveynlerinin yanına döndü ve 1881 yılında resim yapmaya başladı. Küçük kardeşi Theo tarafından maddi olarak desteklendi ve ikisi yıllarca mektupla yazıştılar. Çoğunlukla natürmortlar ve çalışan köylülerin tasvirlerinden oluşan ilk çalışmalarında daha sonraki eserlerinin ayırt edici niteliği olan canlı renkler görülmez. 1886 yılında taşındığı Paris'te, izleni");
                WriteLiteral(@"mci hassasiyete karşı tepki gösteren ve aralarında Émile Bernard ile Paul Gauguin'in de bulunduğu avangart üyeleriyle tanıştı. Çalışmaları geliştikçe natürmortlara ve yerel manzaralara yeni bir yaklaşım getirdi. Resimlerinde daha parlak renkler kullanmaya başladı ve daha sonra 1888'de Fransa'nın güneyinde kaldığı Arles'da ustalaşacağı kendine özgü bir üslûp geliştirdi. Bu dönemde zeytin ağaçları, selviler, buğday tarlaları ve ayçiçekleri de tuvallerine konu olmaya başladı.
                                    </p>
                                    <p>
                                        Psikotik epizodlardan ve delüzyonlardan muzdarip olan van Gogh zihin sağlığından endişe duymasına rağmen fiziksel sağlığını ekseriyetle ihmal etmiş düzgün beslenmemiş ve aşırı alkol almıştır. Gauguin ile arkadaşlığı bir ustura ile yolunu kesmesi ve öfke nöbeti sonucu sol kulağının bir kısmını keserek yaralaması sonucu sona ermiştir. Bir dönem Saint-Rémy'de olmak üzere akıl hastanelerinde kalmıştır. Hastaneden kendi ist");
                WriteLiteral(@"eğiyle ayrıldıktan sonra Paris yakınlarında Auvers-sur-Oise'da Auberge Ravoux'ya taşındı ve homeopati uygulayan doktor Paul Gachet tarafından tedavi edilmeye başladı. Depresyonu devam etti ve 27 Temmuz 1890'da bir altıpatlarla kendini göğsünden vurdu. İki gün sonra yaraları nedeniyle öldü.
                                    </p>
                                    <p>
                                        Yaşadığı sürede başarısız olan van Gogh'a deli gözüyle bakılıyordu. İntiharından sonra şöhret kazanan ressam halkın imgeleminde tipik yanlış anlaşılmış dahi, ""çılgınlık ve yaratıcılığın bir arada olduğu söylemlerini""[2] gösteren bir ressam olarak yer almıştır. Resim üslûbunun ögeleri fovistler ve Alman dışavurumcuları tarafından kullanılmaya başladıktan sonra 20. yüzyılın başlarında ünü artmaya başlamıştır. Sonraki yıllar boyunca çok yaygın bir eleştirel, ticari ve popüler bir başarı yakalayan van Gogh sorunlu kişiliğinin romantik, azap çeken sanatçı idealini simgelediği önemli ama hüzünlü bir ressam o");
                WriteLiteral(@"larak hatırlanmaktadır.
                                    </p>
